import ReactDOM from 'react-dom';

function App() {
  const  date = new Date()
  const hours = date.getHours()
  let timeOfDay 

  if(hours < 12) {
    timeOfDay = "morning",
    styles.color = "yellow"
  }else if (hours >= 12 && hours < 17){
    timeOfDay = "afternoon"
    styles.color = "yellow"
  }else{
    timeOfDay = "night"
  }

  const styles={
    color: 'red', 
    backgroundColor: 'greenyellow',
    fontSize: "200px"
  }

  return(
    <h1 style={styles}>Good {timeOfDay}!!!</h1>
  )

}




